import React, { Component } from 'react';
import { withRouter }       from 'react-router-dom';
// import UserService           from '../../services/user.service';

import ReactQuill           from 'react-quill'; 
import 'react-quill/dist/quill.snow.css';

import Navbar               from '../../components/Common/Navbar/Navbar'
import Footer               from '../../components/Common/Footer/Footer'

import banner               from '../../assets/img/banner/NoBanner.png';
import PostService          from "../../services/post.service";

import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

import OrganisatorService from "../../services/organisator.service";

class PostCreation extends Component {


  state = {

    Processing : false,
    ModeCreation: true,
    imageHaveChanged : false,

    gametypes : null,

    Post : {
      "id" : null,
      "name": "Posty Posta",
      "date": {
        "date": "2021-05-02 01:23:56.000000",
        "timezone_type": 3,
        "timezone": "Europe/Berlin"
      },
      "type_id": 1,
      "content": "Joby Joba lorem ipsum tatati tatata",
      "message": "Joby is our Joba",
      "annonce" : "It is a good product",
      "sponsored": 0,
      "img" :{
        "name" : "postImg",
        "value" : "data:image/jpeg;base64,"
      }
    },





  }


  dualDigit(e) {
    return e = (e < 10) ? "0"+e : e;
  }

// les changers
  handleQuillChangeName (e) {

    this.setState((prevState) => ({Post : {...prevState.Post, name: e}}));
  }

  handleQuillChangeMessage (e) {

    this.setState((prevState) => ({Post : {...prevState.Post, message: e}}));
  }

  handleQuillChangeAnnonce (e) {

    this.setState((prevState) => ({Post : {...prevState.Post, annonce: e}}));
  }

  handleQuillChangeContent (e) {

    this.setState((prevState) => ({Post : {...prevState.Post, content: e}}));
  }

  handleDatePickerChange (e) {
    if (e >= new Date((new Date()).valueOf() - 1000*3600*24)){
      const dateAsTxt = e.getFullYear()+"-"+(this.dualDigit(e.getMonth()+1))+"-"+this.dualDigit(e.getDate())+" "+this.dualDigit(e.getHours())+":"+this.dualDigit(e.getMinutes())+":"+this.dualDigit(e.getSeconds())
      //console.log(dateAsTxt);
      this.setState((prevState) => ({
        Post : {...prevState.Post,
          date : {...prevState.Post.date,
            date : dateAsTxt
          }
        }
      }));
    }
  }

  changeGameForm(e){
    let {id, value, validity} = e.target;
    if(validity.valid){
      this.setState((prevState) => ({
        Post : {...prevState.Post,
          [id] : value
        }
      }));
    }
  }

  async changeImage(e){//e.target.files[0]
    e.preventDefault();
    let reader = new FileReader();
    let file = e.target.files[0];
    console.log("enter");
    reader.onloadend = () => {
      if (reader.result.indexOf("data:image/") === 0){
        console.log(reader.result.indexOf("data:image/"));
        this.setState((prev) => ({
          Post : {
              ...prev.Post,
              img: {
                ...prev.Post.img,
                value: reader.result
              },
              imageHaveChanged: true
          }
        }));
      }
    }
    reader.readAsDataURL(file)
  }

  async componentDidMount() {

    let response = await OrganisatorService.getTypes();
    let json = await response.json();
    this.setState({gametypes : json});


   }



  //handleSubmit
  async handleSubmit(e){
    e.preventDefault();
    await this.setState({Processing : true});
    if (this.state.ModeCreation) {//submit en creation
      PostService.createPost(this.state.Post);
    }else{// submit en mode modification

    }
    await this.setState({Processing : false});

    this.props.history.push('/PostHistoriqueApp', /*OBJ*/);
  }



 render(){
  return (
  <div className="PostCreation">

    <Navbar/>

    <main className="main-container">

      <div className="main-content">
        <div className="row">

          {/*Pannel*/}
          <div className="col-lg-12 tab-content">
            <form className="card form-type-material tab-pane fade active show" id="tab1" onSubmit={(e) => this.handleSubmit(e)}>
              <h4 className="card-title fw-400">Post Creation</h4>

              <div className="card-body">
                <div className="row"> 
                  <div className="col-md-12"> 
                    <div className="card-body text-center">
                      <img className="rounded" src={this.state.Post.img.value ? this.state.Post.img.value : banner} alt="..."/>

                      <div className="d-felx flex-column flex-sm-row gap-y gap-items-2 mt-16">
                        <div className="file-group file-group-inline">
                          <label htmlFor="banner" className="btn btn-sm btn-w-lg btn-outline btn-round btn-secondary">Add Picture</label>
                          <input id="banner" type="file" onChange={(e) => this.changeImage(e)}/>
                        </div>


                      </div>

                    </div>
                  </div>
                </div>
                <div className="row"> 
                  <div className="col-md-6"> 
                    <div className="form-group">
                      <ReactQuill theme="bubble"
                        modules={{toolbar : false}}
                        onChange={(e) => {this.handleQuillChangeName(e)}}
                        value={this.state.Post.name}
                      />
                      <label>Titre</label>
                    </div>
                  </div>
                  <div className="col-md-3"> 
                    <div className="form-group">
                      <ReactQuill theme="bubble"
                        modules={{toolbar : false}}
                        onChange={(e) => {this.handleQuillChangeAnnonce(e)}}
                        value={this.state.Post.annonce}
                      />
                      <label>Annonce</label>
                    </div>
                  </div>
                  <div className="col-md-3"> 
                    <div className="form-group">
                      <ReactQuill theme="bubble"
                        modules={{toolbar : false}}
                        onChange={(e) => {this.handleQuillChangeMessage(e)}}
                        value={this.state.Post.message}
                      />
                      <label>Message d'annonce</label>
                    </div>
                  </div>
                </div>

                <div className="row">
                  <div className="col-md-12">
                    <div className="form-group">
                      <ReactQuill theme="snow"
                        value= {this.state.Post.content}
                        onChange={(e) => {this.handleQuillChangeContent(e)}}
                      />
                    </div>
                  </div>
                </div>
              </div>
              <div className="row">
                <div className="col-md-6">
                  <div className="form-group">
                    <select className="form-control" title="&#xA0;" data-provide="selectpicker"
                            id="type_id" value={this.state.Post.type_id} onChange={(e) => this.changeGameForm(e)}>
                      {
                        this.state.gametypes && this.state.gametypes.map((elem,x) => {
                          return (<option value={elem.id} key={x}>{elem.name}</option>);
                        })
                      }
                    </select>
                    <label>Univers</label>
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-12">
                    <div className="form-group">
                      <DatePicker
                          customInput={<input className="form-control text-center text-info " type="text"/>}
                          dateFormat="dd/MM/yyyy"
                          showMonthDropdown
                          withPortal
                          id="date" onChange={(e) => this.handleDatePickerChange(e)}
                          selected={new Date(this.state.Post.date.date)}/>
                      <label>Date</label>
                    </div>
                  </div>
                </div>
              </div>
              <footer className="card-footer text-right">
                {
                  !this.state.Processing && <button className="btn btn-flat btn-primary" type="submit">Save Changes</button>
                }{
                this.state.Processing &&
                <div className="text-center">Processing
                  <span className="ml-3 spinner-dots">
                        <span className="dot1"></span>
                        <span className="dot2"></span>
                        <span className="dot3"></span>
                      </span>
                </div>
              }
              </footer>
            </form>
          </div>
        </div>
      </div>
    </main>

    <Footer/>

  </div>
  );
 }
}

export default withRouter(PostCreation)

